import logo from "./logo.svg";
import "./App.css";
import { Redirect, Switch, Route } from "react-router";
import Welcome from "./Components/Welcome/Welcome";
import Logout from "./Components/Logout/Logout";
import Login from "./Components/Login/Login";
import NavigationBar from "./Components/NavigationBar/NavigationBar";
import { useSelector } from "react-redux";
import StudentWelcomer from './Components/Users/StudentSection/StudentWelcomer';
import TeacherWelcomer from './Components/Users/TeacherSection/TeacherWelcomer';
import AdminWelcomer from './Components/Users/AdminSection/AdminWelcomer';
function App() {
  const isLoggedin = useSelector((state) => state.auth.isLoggedin);

  return (
    <div className="App">

      <NavigationBar />
      <Switch>
        <Route path="/" exact>
          <Redirect to="/Welcome" />
        </Route>

        <Route path="/Welcome">
          <Welcome />
        </Route>

        {!isLoggedin && (
          <Route path="/Login">
            <Login />
          </Route>
        )}
        {isLoggedin && (
          <Route path="/Logout">
            <Logout />
          </Route>
        )}

        {isLoggedin && userType === "Student" && (
          <Route path="/Welcome/StudentWelcomer"><StudentWelcomer /></Route>
        )}

        {isLoggedin && userType === "Teacher" && (
          <li>
            <NavLink to="/Welcome/TeacherWelcomer"><TeacherWelcomer/></NavLink>
          </li>
        )}

        {isLoggedin && userType === "Admin" && (
          <li>
            <NavLink to="/Welcome/AdminWelcomer"><AdminWelcomer /></NavLink>
          </li>
        )}
      </Switch>
    </div>
  );
}

export default App;
